tables.table_schema:
CREATE TABLE outreach_programs (
	program_id INT PRIMARY KEY,
	program_name VARCHAR(255),
	start_date DATE,
	end_date DATE
);

CREATE TABLE campaign (
    campaign_id SERIAL PRIMARY KEY,
    campaign_name VARCHAR(255) NOT NULL,
    start_date DATE NOT NULL,
    end_date DATE NOT NULL
);

CREATE TABLE outreach_program (
    program_id SERIAL PRIMARY KEY,
    program_name VARCHAR(255) NOT NULL,
    targeting_audience VARCHAR(255) NOT NULL,
    program_type VARCHAR(50) NOT NULL
);

CREATE TABLE outreach_tracking (
    tracking_id SERIAL PRIMARY KEY,
    program_id INT NOT NULL,
    outreach_date DATE NOT NULL,
    outreach_location VARCHAR(255) NOT NULL
);

CREATE TABLE outreach_results (
    result_id SERIAL PRIMARY KEY,
    tracking_id INT NOT NULL,
    outcome VARCHAR(255) NOT NULL,
    effectiveness_rating INT NOT NULL
);
